import React from 'react';
import {Link} from 'react-router-dom';
import { NavLink } from 'react-router-dom';
import Button from 'react-bootstrap/Button';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Image from 'react-bootstrap/Image';
import Container from 'react-bootstrap/Container';
import ListGroup from 'react-bootstrap/ListGroup';
import '../App.css';
import './ringInfo.css';
import logo from '../logo.svg';
import firstHouse from '../assets/1stHouse.png';
import secondHouse from '../assets/2ndHouse.png';
import thirdHouse from '../assets/3rdHouse.png';
import fourthHouse from '../assets/4thHouse.png';
import fifthHouse from '../assets/5thHouse.png';
import sixthHouse from '../assets/6thHouse.png';
import seventhHouse from '../assets/7thHouse.png';
import eigthHouse from '../assets/8thHouse.png';
import ninthHouse from '../assets/9thHouse.png';
import tenthHouse from '../assets/10thHouse.png';
import eleventhHouse from '../assets/11thHouse.png';
import twelfthHouse from '../assets/12thHouse.png';

// import planet, sign and house imgs

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {
  faCaretUp,
  faCaretDown,
  faCaretLeft,
  faCaretRight,
  faTimesCircle,
  faCompass,
  faCode,
  faCodeBranch,
  faArchive,
  faExternalLinkAlt,
  faEllipsisH,
} from '@fortawesome/free-solid-svg-icons';


const RingInfoClick = (props) => {

    return (

      <div className="ringInfo2Top">

        <div>

        <a href="javascript:void(0);" className="clickInfoClose">
          <Button variant="light" className="ringClickCloseBtn" onClick={props.toggleClickInfo}>
            <FontAwesomeIcon icon={faTimesCircle} size="lg"/>
          </Button>
        </a>

        <p>Ring: {props.data.ring} </p>
        <p>Target: {props.data.target} </p>
        <p>Desc: {props.data.desc} </p>
        <p>Coords: {props.data.coords.x}, {props.data.coords.y} </p>
        </div>



      {
        // <p>Coords: {props.data.coords.x}, {props.data.coords.y} </p>
        // <img src={props.data.img} className='mainKnob' alt="logo" />


        // <a href="javascript:void(0);">
        //   <Button variant="light" className="ringClickCloseBtn" onClick={props.closeClickInfo()}>close</Button>
        // </a>
      }


      </div>

    )
}

export default RingInfoClick;
